How to store null in a double field in mongodb<p>My mongodb schema has a field of "double" data type. Sometimes, when there is no value for this field, mongo is storing it as 0.0 but I need it to store as null</p>

<ol>
<li><p><code>db.nulltest.insertOne({ "name": "abc", "salary": null })</code> - When inserted, schema validation fails (which is expected)</p></li>
<li><p><code>db.nulltest.insertOne({ "name": "abc", "salary": Number(null) })</code> - When inserted, stores as 0.0 (<code>"salary" : 0.0</code>)</p></li>
<li><p><code>db.nulltest.insertOne({ "name": "abc", "salary": Number() })</code> - When inserted, stores as 0.0 (<code>"salary" : 0.0</code>)</p></li>
<li><p><code>db.nulltest.insertOne({ "name": "abc", "salary": Number("null") })</code> - When inserted, stored as NaN (<code>"salary" : NaN</code>)</p></li>
</ol>

<p>My Schema:</p>

<pre><code>db.createCollection("nulltest", {
validator: { $jsonSchema: {
    bsonType: "object",
    properties: {
        "name": {
            bsonType: "string"
        },
        "salary": {
            bsonType: "double"
            }
        }}
    }} )
</code></pre>

<p>Question: How can I store null value in a field of double data type? ie: <code>"salary": null</code></p>

