Write a test in jest for adding a property to the response header<p>I'm setting up an authentication server when the user logged in; express should add a property ('x-auth-token') to the response header the route actually working but I don't know how to write a test for that in jest.</p>

<p>here is my route handler;</p>

<pre><code>const bcrypt = require('bcrypt');
const { User } = require('../models/user');
const Joi = require('joi');
const express = require('express');
const router = express.Router();

router.post('/', async (req, res) =&gt; {
  const { error } = validation(req.body);
  if (error) return res.status(400).send(error.details[0].message);

  const { email, password } = req.body;

  const user = await User.findOne({ email });

  if (!user || !(await bcrypt.compare(password, user.password)))
    return res.status(400).send('Invalid email or password.');

  // here express adding the token to header 

  res
    .header('x-auth-token', user.generateAuthToken())
    .send(JSON.stringify(`Welcome dear ${user.name}`));
});

function validation(value) {
  const schema = {
    email: Joi.string()
      .min(10)
      .max(255)
      .email()
      .required(),
    password: Joi.string()
      .min(8)
      .max(1024)
      .required()
  };

  return Joi.validate(value, schema);
}

module.exports = router;

</code></pre>

<p>here is my test:</p>

<p>user is available in MongoDB and email and password are valid.</p>

