Why is my asynch mongodb query function hanging?<p>First of all, please forgive me if this is a duplicate, I am new to coding and Javascript in general.  </p>

<p>I have an async function that queries mongodb based on an objects passed in the function call.  The function executes, and returns the results to a callback function which logs the results to the console, and then hangs.  Ultimately, I want to take the results of the async query and then do something with them outside the original async function. I am not understanding why it hangs after it logs to the console.</p>

<pre><code>const MongoClient = require('mongodb').MongoClient;
let fObj = {
    field : {},
    limit : 100
}

let cObj = {
    dbName : 'myNewDatabase',
    colName : 'newCollection'
}

async function findDoc(cObj,fObj) {
    const url = 'mongodb://localhost:27017';
    const client = new MongoClient(url, { useNewUrlParser: true });
    try {
        await client.connect();
        const db = client.db(cObj.dbName);
        const col = db.collection(cObj.colName);
        console.log(`Connection Made to ${db.databaseName} database.`);
        return await col.find(fObj.field).limit(fObj.limit).toArray();
        client.close();
    } catch (err) {
        console.log(err.stack);
    }
};

findDoc(cObj,fObj).then(function(result) {
    console.log(result);
});
</code></pre>

<p>The code executes, and logs the results to the console, but then hangs.  I have to ctrl-c out to get it to end.  What am I missing?</p>

