Accessing a schema inside a schema using Express Router and MongoDG<p>I'm trying to create a route where it takes in a parameter for a username and then displays that users information. Only thing is, the username is in the user schema from when the user signs up. The profile schema references the user schema. How do I use the username parameter in the findOne call to display the users profile data?</p>

<p>User schema: </p>

<pre><code>const UserSchema = new Schema({
  username: {
    type: String,
    required: true
  },
  email: {
    type: String,
    required: true
  },
  password: {
    type: String,
    required: true
  },
  date: {
    type: Date,
    default: Date.now
  }
});

module.exports = User = mongoose.model("users", UserSchema);
</code></pre>

<p>Profile schema:</p>

<pre><code>const ProfileSchema = new Schema({
  user: {
    type: Schema.Types.ObjectId,
    ref: "users"
  },
  name: {
    type: String
  },
  image: {
    type: String
  },
  bio: {
    type: String
  },
  location: {
    type: String
  },
  website: {
    type: String
  },
  social: {
    youtube: {
      type: String
    },
    facebook: {
      type: String
    },
    instagram: {
      type: String
    },
    twitter: {
      type: String
    }
  }
});

module.exports = User = mongoose.model("profile", ProfileSchema);
</code></pre>

<p>Route:</p>

<pre><code>router.get("/user/:username", (req, res) =&gt; {
  const errors = {};

  Profile.findOne({ user: req.params.user.username })
    .populate("user", "username")
    .then(profile =&gt; {
      if (!profile) {
        errors.noprofile = "There is no profile for this user";
        return res.status(404).json(errors);
      }
      res.json(profile);
    })
    .catch(err =&gt; res.status(404).json(err));
});
</code></pre>

