How to query (find) from multiple Mongo collections at once and combine results<p>I want to get the results from multiple collections that have no relations to one another. I am creating a search engine that will take a term, pass to the back end and do a query/find on multiple collections (Books, Authors, Tags) and combine them into one object to return. There are no foreign keys relation for any of these collections, I just want to find results matching the text term. </p>

<p>However I am having difficulties finding the right solution. The models I am using to do the find queries returns a promise so I want to find a way to properly retrieve since it is asynchronous. </p>

<p>I've tried a Promise.all approach but it ended up failing with a 500 error because I know I did this wrong. </p>

<pre><code>router.post('/', (req, res, next) =&gt; {
   var results = {}, term = req.body.term;

   var authors = Authors.find().or([
                           {first_name: new RegExp(term, 'i')},
                           {last_name: new RegExp(term, 'i')}
                       ]);
   var books = Books.find().or([
                           {title: new RegExp(term, 'i')},
                           {author: new RegExp(term, 'i')},
                           {description: new RegExp(term, 'i')}
                       ]);
   var tags = Tags.find().or([
                           {name: new RegExp(term, 'i')}
                       ]);

   Promise.all([authors, books, tags])
       .then(results =&gt; res.send(results));        
});

</code></pre>

<p>I want to grab the results from all the collections and be able to combine it into a single JSON object. Something like:</p>

<pre><code>{
    books: {
          // results from Books collection
    },
    authors: {
          // results from Authors collection
    },
    tags: {
          // results from Tags collection
    },
}
</code></pre>

